window.PlotWithAxesWdgt_coffeSource = "# REQUIRES KeepsRatioWhenInVerticalStackMixin⤶⤶class PlotWithAxesWdgt extends Widget⤶⤶  @augmentWith KeepsRatioWhenInVerticalStackMixin, @name⤶⤶  constructor: (@plot) ->⤶    super⤶    @plot.drawOnlyPartOfBoundingRect = true⤶    @appearance = new RectangularAppearance @⤶⤶    @add @plot⤶⤶    @vertAxis = new AxisWdgt -5, 5⤶    @add @vertAxis⤶    @horizAxis = new AxisWdgt -5, 5⤶    @add @horizAxis⤶⤶    @setColor new Color 242,242,242⤶⤶    @invalidateLayout()⤶⤶  colloquialName: ->⤶    @plot.colloquialName()⤶⤶  rawSetExtent: (aPoint) ->⤶    super⤶    @invalidateLayout()⤶⤶  doLayout: (newBoundsForThisLayout) ->⤶    #if !window.recalculatingLayouts⤶    #  debugger⤶⤶    if !newBoundsForThisLayout?⤶      if @desiredExtent?⤶        newBoundsForThisLayout = @desiredExtent⤶        @desiredExtent = nil⤶      else⤶        newBoundsForThisLayout = @extent()⤶⤶      if @desiredPosition?⤶        newBoundsForThisLayout = (new Rectangle @desiredPosition).setBoundsWidthAndHeight newBoundsForThisLayout⤶        @desiredPosition = nil⤶      else⤶        newBoundsForThisLayout = (new Rectangle @position()).setBoundsWidthAndHeight newBoundsForThisLayout⤶⤶    if @isCollapsed()⤶      @layoutIsValid = true⤶      @notifyChildrenThatParentHasReLayouted()⤶      return⤶⤶    @rawSetBounds newBoundsForThisLayout⤶⤶    # here we are disabling all the broken⤶    # rectangles. The reason is that all the⤶    # submorphs of the inspector are within the⤶    # bounds of the parent Widget. This means that⤶    # if only the parent morph breaks its rectangle⤶    # then everything is OK.⤶    # Also note that if you attach something else to its⤶    # boundary in a way that sticks out, that's still⤶    # going to be painted and moved OK.⤶    trackChanges.push false⤶⤶    height = @height()⤶    width = @width()⤶⤶    ftft = 35⤶⤶    @vertAxis.rawSetExtent (new Point width/10 - 4, height).round()⤶    @vertAxis.fullRawMoveTo (@position().add new Point 0, -2).subtract((new Point -width/ftft,height/ftft).round())⤶⤶    @horizAxis.rawSetExtent (new Point width, height/10).round()⤶    adjustmentX = (@vertAxis.left() + @horizAxis.distanceOfAxisOriginFromEdge().x) - ( @vertAxis.right() + @vertAxis.distanceOfAxisOriginFromEdge().x )⤶    @horizAxis.fullRawMoveTo (@bottomLeft().subtract new Point adjustmentX, height/10).round().subtract((new Point -width/ftft,height/ftft).round())⤶⤶    @plot.rawSetExtent (new Point width - 2 *  @horizAxis.distanceOfAxisOriginFromEdge().x , height - 2 *  @vertAxis.distanceOfAxisOriginFromEdge().y).round()⤶    @plot.fullRawMoveTo (@position().add new Point @horizAxis.distanceOfAxisOriginFromEdge().x - adjustmentX + 1, @vertAxis.distanceOfAxisOriginFromEdge().y - 1).round().subtract((new Point -width/ftft,height/ftft).round())⤶⤶    trackChanges.pop()⤶    @fullChanged()⤶⤶    @layoutIsValid = true⤶    @notifyChildrenThatParentHasReLayouted()⤶⤶    if Automator? and Automator.state != Automator.IDLE and Automator.alignmentOfMorphIDsMechanism⤶      world.alignIDsOfNextMorphsInSystemTests()".replace(/＂/g, "\"").replace(/⧹/g, "\\").replace(/⤶/g, "\n");

window.Point3D_coffeSource = "# REQUIRES DeepCopierMixin⤶⤶# adapted from thomasdarimont/spinning-cube.html⤶# https://gist.github.com/thomasdarimont/8c694b4522c6cb10d85c⤶⤶class Point3D⤶⤶  @augmentWith DeepCopierMixin⤶⤶  x: nil⤶  y: nil⤶  z: nil⤶⤶  constructor: (@x = 0, @y = 0, @z = 0) ->⤶⤶  # the order of the rotations does matter⤶  # and there is no reason to assume⤶  # a specific order, so we leave the⤶  # three rotations separate⤶⤶  rotateX: (angle) ->⤶    rad = angle * Math.PI / 180⤶    cosa = Math.cos rad⤶    sina = Math.sin rad⤶    y = @y * cosa - @z * sina⤶    z = @y * sina + @z * cosa⤶    new @constructor @x, y, z⤶⤶  rotateY: (angle) ->⤶    rad = angle * Math.PI / 180⤶    cosa = Math.cos rad⤶    sina = Math.sin rad⤶    z = @z * cosa - @x * sina⤶    x = @z * sina + @x * cosa⤶    new @constructor x, @y, z⤶⤶  rotateZ: (angle) ->⤶    rad = angle * Math.PI / 180⤶    cosa = Math.cos rad⤶    sina = Math.sin rad⤶    x = @x * cosa - @y * sina⤶    y = @x * sina + @y * cosa⤶    new @constructor x, y, @z⤶⤶  # the order of the translations doesn't matter⤶  # so one can do them all together⤶⤶  translateXYZ: (dx,dy,dz) ->⤶    new @constructor @x+dx, @y+dy, @z+dz⤶⤶  project: (viewWidth, viewHeight, fieldOfView, viewDistance) ->⤶    factor = fieldOfView / (viewDistance + @z)⤶    x = @x * factor + viewWidth / 2⤶    y = @y * factor + viewHeight / 2⤶    new Point x, y⤶".replace(/＂/g, "\"").replace(/⧹/g, "\\").replace(/⤶/g, "\n");

